CREATE TABLE Facts(idProject INT, nameProject VARCHAR(200), state ENUM('failed', 'successful', 'canceled', 'live', 'undefined', 'suspended'), backers INT, pledged FLOAT, goal FLOAT, usd_pledged FLOAT, usd_goal FLOAT, financingRate FLOAT, duration INT, averageDonation FLOAT, idCountry INT, CONSTRAINT fk_idCountry FOREIGN KEY (idCountry) REFERENCES Country(idCountry) ON DELETE CASCADE ON UPDATE CASCADE, idCurrency INT, CONSTRAINT fk_idCurrency FOREIGN KEY (idCurrency) REFERENCES Currency(idCurrency) ON DELETE CASCADE ON UPDATE CASCADE, idCategory INT, CONSTRAINT fk_idCategory FOREIGN KEY (idCategory) REFERENCES Category(idCategory) ON DELETE CASCADE ON UPDATE CASCADE, idMainCategory INT,  CONSTRAINT fk_idMainCategory FOREIGN KEY (idMainCategory) REFERENCES MainCategory(idMainCategory) ON DELETE CASCADE ON UPDATE CASCADE, idDateTimeLaunch INT, CONSTRAINT fk_idDateTimeLaunch FOREIGN KEY (idDateTimeLaunch) REFERENCES DateTime(idDateTime) ON DELETE CASCADE ON UPDATE CASCADE, idDateTimeDeadline INT, CONSTRAINT fk_idDateTimeDeadline FOREIGN KEY (idDateTimeDeadline) REFERENCES DateTime(idDateTime) ON DELETE CASCADE ON UPDATE CASCADE, PRIMARY KEY (idProject));
